import './Search.css';
import { BsXCircle } from 'react-icons/bs';
import useButtonSide from '../../store/index';

const Search = () => {
  const removeButton = useButtonSide((state) => state.removeStatus);

  return (
    <>
      <div className='container search'>
        <span onClick={useButtonSide}><BsXCircle /></span>
        <form>
          <input type='text' name='search' placeholder='Search...' autoFocus='true' autoComplete='off' />
        </form>
      </div>
    </>
  )
}

export default Search;
